struct Tile {
    int x;          // X coordinate of the tile
    int y;          // Y coordinate of the tile
    int width;      // Width of the tile
    int height;     // Height of the tile
    int strength;   // Strength level of the tile
    bool active;    // Flag to indicate if the tile is active or destroyed
	enum Color color;
};

struct Powerup {
    int x;            // X coordinate of the powerup
    int y;            // Y coordinate of the powerup
    enum PowerupType type; // Type of the powerup
    bool active;      // Flag to indicate if the powerup is active
};

struct audio_t {
    volatile unsigned int control;  // The control/status register
    volatile unsigned char rarc;    // the 8 bit RARC register
    volatile unsigned char ralc;    // the 8 bit RALC register
    volatile unsigned char wsrc;    // the 8 bit WSRC register
    volatile unsigned char wslc;    // the 8 bit WSLC register
    volatile unsigned int ldata;    // the 32 bit (really 24) left data register
    volatile unsigned int rdata;    // the 32 bit (really 24) right data register
};

